      .then(res => {
        setPosts(res.data);
        console.log(posts);
      })
    }
    fetchPosts();
  },[])
  return (
    <div>
      <h1>Account</h1>
      <NewPost />
      <h1>My Post</h1>
      {posts.map(p => {
        <div>
         {p.imgUrl.map(i => (
          <img src={i} alt="" width={300}/>
        ))}
